import React from "react";

const Navbar = () => {
    return(
        <div style={{ padding:'0 50px', display: "flex", justifyContent:'space-between', alignItems:'center', width:'100%', height:'100px', position:'absolute', backgroundColor:'white' }}>
            <div style={{ fontFamily:'Quicksand', fontSize:'24px' }}>Khamilah Nixon | Projects</div>
            <div style={{ fontFamily:'Quicksand',display:'flex', gap:'50px' }}>
                <a>Home</a>
                <a>Projects</a>
            </div>
        </div>
    );
}

export default Navbar;
